import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/SearchPage.css';
import Header from '../components/Header';
import Footer from '../components/Footer';

const AddPlace = () => {
    const [searchQuery, setSearchQuery] = useState('');
    const navigate = useNavigate();

  const handleSearchChange = (e) => {
    setSearchQuery(e.target.value);
  };

  const handleSearchSubmit = async (e) => {
    e.preventDefault();
    // Fetch search results from the backend
    try {
      const response = await fetch(`http://localhost:3001/search?query=${searchQuery}`);
      const results = await response.json();
      navigate('/searchresult', { state: { results } });
    } catch (error) {
      console.error('Error fetching search results:', error);
    }
  };

  const [formData, setFormData] = useState({
    placeName: '',
    address: '',
    description: '',
    rating: '',
    reviewText: '',
    userName: '',
    email: '',
  });

  const defaultImage = '/path/to/default/image.jpg'; // Replace with your default image path

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:3001/place', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });
      const data = await response.json();
      if (response.ok) {
        alert('Place added successfully!');
      } else {
        alert(`Failed to add place: ${data.message}`);
      }
    } catch (error) {
      console.error('Error adding place:', error);
      alert('Failed to add place.');
    }
  };

  return (
    <div className="page-container">
      <Header />
      <div className="content-wrap">
        <div className="add-place-page">
          <div className="container">
            <div className="row">
              <div className="col-md-12">
                <h4 className="trans-uppercase mb-10">Add a Place</h4>
                <div className="cws_divider mb-30"></div>
              </div>
            </div>
            <div className="review-content pattern relative">
              <div className="row">
                <div className="col-md-5 mb-md-30 mb-xs-0">
                  <div className="review-total">
                    <img src={defaultImage} alt="review" />
                    <div className="review-total-content">
                      <h6>{formData.placeName}</h6>
                      <div className="stars stars-4"></div>
                      <ul className="icon">
                        <li>{formData.address}<i className="flaticon-suntour-map"></i></li>
                      </ul>
                    </div>
                  </div>
                </div>
                <div className="col-md-7">
                  <div className="review-body">
                    <form onSubmit={handleSubmit}>
                      <div className="form-group">
                        <label>Place Name *</label>
                        <input
                          type="text"
                          name="placeName"
                          className="form-control"
                          value={formData.placeName}
                          onChange={handleChange}
                          required
                        />
                      </div>
                      <div className="form-group">
                        <label>Address *</label>
                        <input
                          type="text"
                          name="address"
                          className="form-control"
                          value={formData.address}
                          onChange={handleChange}
                          required
                        />
                      </div>
                      <div className="form-group">
                        <label>Description *</label>
                        <textarea
                          name="description"
                          className="form-control"
                          rows="3"
                          value={formData.description}
                          onChange={handleChange}
                          required
                        ></textarea>
                      </div>
                      <div className="form-group">
                        <label>Rating *</label>
                        <input
                          type="number"
                          name="rating"
                          className="form-control"
                          value={formData.rating}
                          onChange={handleChange}
                          min="1"
                          max="5"
                          required
                        />
                      </div>
                      <div className="form-group">
                        <label>Your Name *</label>
                        <input
                          type="text"
                          name="userName"
                          className="form-control"
                          value={formData.userName}
                          onChange={handleChange}
                          required
                        />
                      </div>
                      <div className="form-group">
                        <label>Your Email *</label>
                        <input
                          type="email"
                          name="email"
                          className="form-control"
                          value={formData.email}
                          onChange={handleChange}
                          required
                        />
                      </div>
                      <div className="form-group">
                        <label>Your Review *</label>
                        <textarea
                          name="reviewText"
                          className="form-control"
                          rows="5"
                          value={formData.reviewText}
                          onChange={handleChange}
                          required
                        ></textarea>
                      </div>
                      <button type="submit" className="cws-button alt">Submit</button>
                    </form>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default AddPlace;
